import FingerprintJS from '@fingerprintjs/fingerprintjs'

// interface
export default defineComponent({

  setup() {

    const fdic = ref(
      'data:image/html;base64,'
    )
    const eye_closed = ref(
      'data:image/png;base64,'
    )
